INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (216,'060','재물도 있고 권리도 있으니 주위의 사람들로부터 많은 칭찬과 존경을 받게될 것입니다. 뱀의 고기가 바다를 나가니 의기가 양양합니다. 가까운 사람과 사이좋게 지내며 출입하게 되면 그들이 귀인이 되므로 도움을 얻게 됩니다. 원하는 것마다 이루게 되고 마음대로 활동하게 되는 좋은 운세입니다. 일신이 영위 하게 되니 재물이 풍족합니다. 많은 의를 추수하게 되니 많은 재물을 모아두게 되며 내일을 위하여 좋아놓게 되겠습니다. 복이 누궁에 굴드니 마음이 흔쾌합니다. 동북양방의 귀신이 나를 돕겠습니다. 용마가 나타나자 애국이 그 말을 올고 다니듯 마음 정하는 대로 운세가 흘러나가므로 성취하는 일이 많고 복력이 한말하겠습니다.','고기와 용이 물을 만난 듯 의기가 양양합니다. 일신이 안락하게 되고 일은 순조롭게 진행되므로 날로 천금을 얻어 액이게 되겠습니다. 재물이 풍만하므로 집안이 태평하고 안락이 굴들어 억제나 화기왕왕하게 됩니다. 만나는 것마다 기쁨입니다.','순풍에 배를 타니 편안한 천리를 가게됩니다. 액운이 없으므로 순조로이 사업이 번창하겠으나 친한 사람에게서 해를 입을 수 있으니 독자하는 것은 피하는 게 좋습니다. 만일 주의하지 않으면 과력이 있하겠습니다. 기쁨의 씨앗이 집안에 있습니다.','만약 귀인을 만나게 되면 큰 도움을 얻게 되고 그로 인해 반드시 성공하게 될 것입니다. 모든 사람이 당신의 이름을 사방에 전하니 그 이름이 빛나게 되겠습니다. 집안에는 경사가 생기게 되고 기쁨이 집안에 가득하게 되겠습니다. 항상 베풀면 복을 더하게 될 것입니다.','온 들판에 흔택이 드니 만인이 스스로 즐기겠습니다. 운수가 대길하므로 청탁하려 애쓰지 않아도 스스로 얻게 되는 좋은 운수입니다. 동쪽으로 출입하게 되면 운을 가로막아 관재가 생기게 되니 조심하는 것이 좋겠습니다.','재물이 곳곳에 가득하니 편안하고 태평합니다. 재물이 많아 안정하게 되니 마음은 날로 편안합니다. 목마른 용이 물을 얻었으니 재력이 든든합니다. 그러나 혹 다른 사람을 믿어 경솔히 행하면 좋지 않습니다. 만족을 기이 여겨 마음을 다하면 얻는 것이 크겠습니다.','어떤 속가 날계가 있으나 날려고 애를 써도 날지 못하는 답답한 일이 생기겠습니다. 비록 운은 좋지 못하나 여자로 인해 재물이 생길 경함은 면하게 되겠습니다. 다투지 마십시오. 참지 못하고 허기를 부리면 더 큰 구설에 시달리게 됩니다.','일신이 공고하니 운이 그런 걸 어찌 하겠습니까. 일이 보여가지 못하고 몸은 피곤함에 지치게 되겠습니다. 재물을 의지하면 구하려 해도 재물이 모이지 않고 흐려지기만 합니다. 먼저는 길하고 나중은 흉하니 길흉이 반반이겠습니다.','아침과 저녁에 몸이 꼭 사이에서 놀고 있으니 즐겁겠습니다. 다행이 귀인을 만나게 되고 생활이 태평하게 되겠습니다. 길운이 따르게되니 흉함이 길함으로 바뀌겠습니다. 과력이 몸에 따르니 이름이 사방에 높고 많은 이가 우러러보겠습니다.','수많은 가운데 우연히 복록이 들어 어디를 가운데 초부를 밝히는 격입니다. 어려운 일 가운데 길함이 있어 마침내 길한 운세를 갖게 됩니다. 재물이 동방에 있으니 우연히 오게 되며 꿋꿋하는 일이 성공하게 되겠습니다.','복바람 가는 비에 풍년이 청정하겠습니다. 운수가 대길하고 마음이 편안합니다. 재물을 함에 다소 애로가 있거나 혹은 구설수가 있을 수 있는 운세입니다. 그러나 마음을 넓그러이 하면 복력이 몸에 따라 의식이 넉넉하고 풍족한 사람을 낳듦 수 있겠습니다.','좋은 운이 들게 되니 화사한 기운이 들겠습니다. 사람들이 우러러보고 있으니 하는 일에 선한 마음을 지니면 그만큼 복이 따르겠습니다. 뜻을 세우고 사람들을 대하면 이름이 높아지고 복력이 산처럼 쌓이게 될 것입니다.','집안 사람들의 마음이 하나로 뭉치면 뜻이 있고 좋은 일이 화합하는 가정 안에서 생기겠습니다. 명산에 들어가 충분한 마음으로 기도하면 근심이 흐려지고 길흉이 원성하겠습니다, 복력이 풍만하고 몸과 마음이 편안하며 일신이영귀하게 될 것입니다.','2025-03-02 12:01:07.588665+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (429,'060','有财富和权利，因此您将受到周围人的称赞和尊重。随着蛇的肉从海中出来，乐器是扬阳。如果您与一个亲密的人相处，您将得到帮助，因为他们变得崇高。这是一个好运，将在每一个期望并随意工作。公义是丰富的，因此财富丰富。当我们收获很多公义时，我们将收集很多财富，并将对明天有好处。祝福，我对此感到满意。东北房间的幽灵会帮助我。当马匹出现马时，爱国主义的流动仿佛爱国主义者即将到来，所以我将有很多成就，我会说。','好像肉和龙遇到了水。随着太阳的安慰并顺利进行，它将在一天之前支付。因为财富已经充满，房屋是和平的，舒适的继承权，或者被压制或蜂蜜之王。您遇到的每一件事都是喜悦。','当您在纯粹的风中拿起船时，您将享受舒适的一千。由于没有运气，因此这项业务会蓬勃发展，但是亲密的人可能会伤害它，因此请避免阅读。如果没有，那将是压倒性的。喜悦的种子在屋子里。','如果您遇到贵族，您将获得很大的帮助，这肯定会成功。每个人都在任何地方传达您的名字，名字将闪耀。房子将被倾斜，欢乐将被填补在房子里。如果您总是给予祝福，您将增加祝福。','我会在田野里开心。您不想问您要问的好运。如果您进入并退出东部，您将谨慎。','这是舒适和和平的，因为财富很饱。有很多财富，所以头脑每天都很舒适。口渴的龙得了水，所以它很坚固。但是，相信别人并轻率地做是不好的。如果您满意，那么获得它会很棒。','有一件令人沮丧的事情，但是即使您尝试飞行，也无法飞行令人沮丧。尽管幸运不好，但将避免财富的货物。不要吵架。如果您无法忍受，您将遭受更大的观点。','您想做什么，因为您的生活扎实？我无法展示我的工作，我的身体会很累。如果您依靠财富，即使您尝试获得财富，也只会模糊。首先，这很长，我们丑陋。','这会很有趣，因为身体在早晨和晚上都在玩。幸运的是，我会遇到高贵的人，我的生活将是和平的。由于将遵循道路，因此丑陋将改变。当身体跟随身体时，这个名字到处都很高，许多人会抬头。','在许多方面，这是一条规则，它揭示了中间的中间。艰难的事情有很长一段时间，所以您终于有了很长的财富。财富在东方，因此他们会偶然碰巧，这项工作将取得成功。','雨中的丰度将很干净。幸运很舒服，我很舒服。这是一种财富可能很难做到的财富。但是，如果您想到直到自己的想法，那么您的身体可能会有一个慷慨而丰富的人。','我很幸运能变得聪明。人们正在抬头，因此，如果您对自己的工作有良好的心，那么您将受到祝福。如果您有意义并与人打交道，您的名字将更高，您的力量会像山一样积累。','如果家庭的心团结在一起，那将是有意义的，美好的事物将出现在一个美好事物和谐的家庭中。如果您去Myeongsan并用足够的心祈祷，您将会变得模糊，方式会变得模糊。','2025-03-02 12:01:07.588665+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (500,'060','富と権利があるので、あなたはあなたの周りの人々から賞賛され、尊敬されます。ヘビの肉が海から出ると、楽器は陽です。あなたが親しい人と仲良くするなら、あなたは彼らが貴族になるので助けられます。それは、すべての望ましいもので達成され、自由に働くことが幸運です。義は豊かであるため、富は豊富です。私たちが多くの正義を収穫するので、私たちは多くの富を集め、明日には良いでしょう。祝福されて、私はこれに満足しています。北東の部屋の幽霊が私を助けてくれます。馬が現れると、愛国心が愛国的なものが言葉に来ているかのように流れるので、私は多くの成果を上げて話します。','まるで肉とドラゴンが水に出会ったかのように。太陽が慰められ、仕事がスムーズに進行するにつれて、その日までに支払われます。富がいっぱいであるため、家は平和であり、慰めは継承されており、抑制されているか、蜂蜜の王です。あなたが出会うすべてのものは喜びです。','純粋な風でボートを手に入れると、快適な千人に行きます。運がないので、このビジネスは繁栄しますが、親しい人に害を及ぼす可能性があるので、読むことは避けてください。そうでない場合、それは圧倒的です。喜びの種は家にあります。','あなたがノーブルに会うなら、あなたは大きな助けを得るでしょう、そしてそれは確かに成功するでしょう。誰もがどこでもあなたの名前を伝え、名前は輝きます。家は傾斜し、喜びは家で満たされます。あなたがいつも祝福を与えるなら、あなたは祝福を加えます。','私は畑で自分自身を楽しんでいます。尋ねるように頼むことなく、あなたがあなたに手に入れるのは幸運です。あなたが東に入って出口を出て、あなたは慎重になります。','富がいっぱいなので、それは快適で平和です。多くの富があるので、心は毎日快適です。のどが渇いたドラゴンは水を得るので、それは強いです。しかし、他の誰かを信じて、発疹をするのは良くありません。あなたが満足しているなら、それを手に入れるのは素晴らしいことです。','イライラする息苦しいものがありますが、飛んでも飛ぶことができないことはイライラします。ラッキーは良くありませんが、富の濡れは避けられます。口論しないでください。あなたがそれを我慢できないなら、あなたはより大きなポイントに苦しむでしょう。','あなたの人生はしっかりしているので、あなたは何をしたいですか？私は自分の仕事を見せられず、私の体は疲れます。あなたが富に頼っていれば、たとえそれを手に入れようとしたとしても、それはぼやけてしまうだけです。まず、それは長く、私たちは醜いです。','体が朝と夕方の間に遊んでいるので楽しいでしょう。幸いなことに、私は高貴な人に会い、私の人生は平和になります。道路が守られるので、醜いものが変更されます。体が体に続くと、名前はどこでも高く、多くの人が見上げます。','多くの点で、それは中央の中央の真ん中を明らかにするルールです。困難なことには長い時間があるので、ついに長い大金があります。富は東にあるので、彼らは偶然来て、仕事は成功します。','豊富さは雨の中できれいになります。ラッキーは快適で、私は快適です。それは富でやるのがやや難しいかもしれない財産です。しかし、あなたがあなたの心を作るなら、あなたはあなたの体に寛大で豊富な人を持つことができます。','私は明るいことを幸運に思うでしょう。人々は見上げているので、あなたがあなたがしていることに良い心を持っているなら、あなたは祝福されます。あなたが意味を作り、人々と対処すれば、あなたの名前は高くなり、あなたの力は山のように蓄積します。','家庭の心が一緒に団結している場合、それは意味のあるものであり、良いことが調和のとれた家族に良いことがもたらされます。 Myeongsanに行って、十分な心で祈ると、あなたはぼやけて、道がぼやけます。','2025-03-02 12:01:07.588665+00','j');
